import { ClosedCaption, Home, SupervisorAccount, TableChart } from '@material-ui/icons';
import React from 'react';

export const SideMenuData = [
    {
        title: "Dashboard",
        icon: <Home />,
        link: "/dashboard"
    },
    {
        title: "Associações",
        icon: <TableChart />,
        link: "/associacoes"
    },
    {
        title: "Membros",
        icon: <SupervisorAccount />,
        link: "/membros"
    },
    {
        title: "Administradores",
        icon: <SupervisorAccount />,
        link: "/administradores"
    },
    {
        title: "Membros Desativar",
        icon: <SupervisorAccount />,
        link: "/membros_desativar"
    },
    {
        title: "Associações Desativar",
        icon: <ClosedCaption />,
        link: "/associacoes_desativar"
    },
    {
        title: "Administradores Desativar",
        icon: <SupervisorAccount />,
        link: "/administradores_desativar"
    },
    
]
